module.exports = {
    name: "level",
    aliases: ["seviye", "xp", "lvl", "rank"],
    execute: async (client, message, args, embed, author) => {
        let user = message.mentions.members.first() || author|| message.guild.members.cache.get(args[0]);
        if (!user) return;
        let data = qdb.get("level.members");
        if (!data)
            data = qdb.set("level.members", {});
        let udata = data[user.id];
        if (!udata) {
            udata = qdb.set("level.members." + user.id, {
                Level: 0,
                XP: 0
            });
            udata = {
                Level: 0,
                XP: 0
            };
            data[user.id] = udata;
        }
        let sƒ±r = Object.keys(data);
        let sƒ±ralama = sƒ±r.sort((a, b) => (getLevelExp(data[b].Level) + data[b].XP) - (getLevelExp(data[a].Level) + data[a].XP)).indexOf(user.id) + 1;
        message.channel.send(embed
            .setDescription(`üî∑ ${udata.Level}. seviye, ${udata.XP} tecr√ºbe puanƒ±n var.`)
            .addField("Sonraki Seviye", `üîπ ${getLevelExp(udata.Level++) - udata.XP} XP sonra`, true))
    }
}

function getLevelExp(level) {
    return 5 * Math.pow(level, 2) + 50 * level + 100;
}

